}

class App extends Component {
  constructor() {
    super()
    this.state = {
      input: ''
    }
  }

onInputChange = (event) => {
  console.log(event.target.value);
}

  render() {
    return (
      <div className="App">
        <Particles className= 'particles'
          params={particlesOption}
        />
      <Navigation/>
      <Logo/>
      <Rank/>
      <ImageLinkForm onInputChange={this.onInputChange}/>
       {/*
            <FaceRocgnition/> */}   
      </div>
    );
  }
}

export default App;
